	public static String lengthOfLongestSubstring(String s) {

		String longest = "";
		int longestLength = 0;

		String[] tempStringArr = s.split("");

		StringBuilder temp = new StringBuilder();
//	    temp.append(tempStringArr[0]);

	    int j= 0;
		for (int i = 0; i < tempStringArr.length ; i++) {

			if (temp.indexOf(tempStringArr[i]) != -1) {
				if (temp.length() > longestLength) {
					longestLength = temp.length();
					longest = temp.toString();

				}
//				System.out.println(temp.indexOf(tempStringArr[i]));
//				System.out.println(temp.toString());
				
				j = temp.indexOf(tempStringArr[i])+1;
				
				String newStr = temp.substring(j);
				temp = new StringBuilder(newStr);
				temp.append(tempStringArr[i]);

			} else {
				
				temp.append(tempStringArr[i]);
//				System.out.println(temp.toString());
			}

		}

		if (temp.length() > longestLength) {
			longestLength = temp.length();
			longest = temp.toString();

		}
		return longest;

	}
	
	
	public static long lengthOfLongestSubstring2(String s) {
        int n = s.length(), ans = 0;

        // Current index of character.
        int[] index = new int[128];

        // Attempt to extend the range.
        int i = 0;
        for (int j = 0; j < n; j++) {
            i = Math.max(index[s.charAt(j)], i);
            ans = Math.max(ans, j - i + 1);
            index[s.charAt(j)] = j + 1;
        }
        return ans;
	}
